function Data(){

    const getData = () =>{
        fetch ('https://randomuser.me/api/')
        .then((response) => response.json())
        .then((data) =>{
            console.log(data);
        })
    }
    return (
        <div>
            <button onClick={getData}>Fetch Data</button>
            <p>matt Robinson - mat@example.com</p>
        </div>
    )
}

export default Data;
